import React from "react";
import { Link } from "react-router-dom";
import { StyledNavbar } from "../styles/StyledNavbar";

const Navbar = () => (
  <StyledNavbar>
    <h1>POKÉDEX</h1>
    <div className="links">
      <Link to="/">Home</Link>
      <Link to="/pokemons">Pokémons</Link>
    </div>
  </StyledNavbar>
);

export default Navbar;
